class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $modulo
     * @param Integer $k
     * @return Integer
     */
    function countInterestingSubarrays($nums, $modulo, $k) {
        $count = 0;
        $n = count($nums);
        for ($i = 0; $i < $n; $i++) {
            $cnt = 0;
            for ($j = $i; $j < $n; $j++) {
                if ($nums[$j] % $modulo == $k) $cnt++;
                if ($cnt % $modulo == $k) $count++;
            }
        }
        return $count;
    }
}
